import { useParams } from 'react-router-dom';
import cssStyle from '../css/Detail.module.css';

export default function Detail({ totalData }) {
  let { id } = useParams();
  let item = totalData.find((a) => a.id == id);
  // let reData = item.filter((a) => a.category === item.category);
  return (
    <main>
      <section className={cssStyle.detail}>
        <img src={`img/${item.image}`} alt={item.title} />
        <p className='title'>{item[id].title}</p>
        <p className='date'>{item[id].startDate}</p>
      </section>
    </main>
  );
}
